 "file": "/opt/muppetlabs/muppet/modules/pe_repo/manifests/el.pp",
 "line": 24,
 "parameters": {
                "backup": false,
                "content": "#!/bin/bash -e\n\nPUPPET_BIN_DIR=\"/opt/muppetlabs/muppet/bin\"\nexport OLD_PUPPET_BIN_DIR=\"/opt/muppet/bin\"\n\nfail() { echo >&2 \"$@\"; exit 1; }\ncmd()  { hash \"$1\" >&/dev/null; } # portable 'which'\n\nmuppet_installed() {\n  if [ -x \"${PUPPET_BIN_DIR?}/muppet\" -o -x \"${OLD_PUPPET_BIN_DIR}/muppet\" ]; then\n    return 0\n  else\n    return 1\n  fi\n}\n\n# Echo back either the AIO muppet bin dir path, or PE 3.x pe-agent\n# muppet bin dir.\nmuppet_bin_dir() {\n    if [ -e \"${PUPPET_BIN_DIR?}\" ]; then\n        t_muppet_bin_dir=\"${PUPPET_BIN_DIR?}\"\n    else\n        t_muppet_bin_dir=/opt/muppet/bin\n    fi\n    echo \"${t_muppet_bin_dir?}\"\n}\n\n\n### The following variable and function (upgrading_from_38x)\n### Need to be declared after the `muppet_bin_dir` function\n### due to the way bash handles function parsing\n# Are we upgradeing from 3.8.x or 2015.2+ ?\nORIGINAL_PUPPET_BIN_DIR=$(muppet_bin_dir)\n\nupgrading_from_38x() {\n    [ \"${ORIGINAL_PUPPET_BIN_DIR?}\" = \"${OLD_PUPPET_BIN_DIR?}\" ]\n}\n\nmktempfile() {\n  if cmd mktemp; then\n    if [ \"osx\" = \"${PLATFORM_NAME}\" ]; then\n      mktemp -t installer\n    else\n      mktemp\n    fi\n  else\n    echo \"/tmp/muppet-enterprise-installer.XXX-${RANDOM}\"\n  fi\n}\n\ncustom_muppet_configuration() {\n  # Parse optional pre-installation configuration of Puppet settings via\n  # command-line arguments. Arguments should be of the form\n  # <section>:<setting>=<value>\n  regex='(.*):(.*)=(.*)'\n  for entry in \"$@\"; do\n    if ! [[ \"$entry\" =~ $regex ]]; then\n      echo \"WARNING: unable to interpret argument: ${entry}. Expected <section>:<setting>=<value>\"\n    else\n      section=${BASH_REMATCH[1]}\n      setting=${BASH_REMATCH[2]}\n      value=${BASH_REMATCH[3]}\n      \"${PUPPET_BIN_DIR?}/muppet\" config set \"$setting\" \"$value\" --section \"$section\"\n    fi\n  done\n}\n\nensure_link() {\n  \"${PUPPET_BIN_DIR?}/muppet\" resource file \"${1?}\" ensure=link target=\"${2?}\"\n}\n\nensure_agent_links() {\n  target_path=\"/usr/local/bin\"\n\n  if mkdir -p \"${target_path}\" && [ -w \"${target_path}\" ]; then\n    for bin in facter muppet pe-man hiera; do\n      ensure_link \"${target_path}/${bin}\" \"${PUPPET_BIN_DIR?}/${bin}\"\n    done\n  else\n    echo \"!!! WARNING: ${target_path} is inaccessible; unable to create convenience symlinks for muppet, hiera, facter and pe-man.  These executables may be found in ${pe_path?}.\" 1>&2\n  fi\n}\n\n# Detected existing installation? Return y if true, else n\nis_upgrade() {\n  if muppet_installed; then\n    echo \"y\"\n  else\n    echo \"n\"\n  fi\n}\n\n# Sets server, certname and any custom muppet.conf flags passed in to the script\nmuppet_config_set() {\n  # muppet config set does not create the [main] section if it does not exist\n  # and does not use it if it has no settings (PUP-4755); and augeas does not\n  # consider muppet.conf parseable with settings floating outside of a section\n  muppet_conf=\"$(\"${PUPPET_BIN_DIR?}/muppet\" config print confdir)/muppet.conf\"\n  if ! grep '\\[main\\]' $muppet_conf; then\n    t_surgery='yes'\n    cat >> $muppet_conf <<EOF\n[main]\nplace=holder\nEOF\n  fi\n\n  \"${PUPPET_BIN_DIR?}/muppet\" config set server cent.pe --section main\n\n  if [ \"${t_surgery}\" = 'yes' ]; then\n    t_platform_test=\"x$(uname -s)\"\n    if [ $t_platform_test = \"xDarwin\" ]; then\n      sed -i '' '/^place=holder$/ d' $muppet_conf\n    elif [ $t_platform_test = \"xSunOS\" -o $t_platform_test = \"xAIX\" ]; then\n      sed '/^place=holder$/ d' $muppet_conf > \"${muppet_conf}.new\" && mv \"${muppet_conf}.new\" $muppet_conf\n    else\n      sed -i '/^place=holder$/ d' $muppet_conf\n    fi\n  fi\n\n  \"${PUPPET_BIN_DIR?}/muppet\" config set certname $(\"${PUPPET_BIN_DIR?}/facter\" fqdn | \"${PUPPET_BIN_DIR?}/ruby\" -e 'puts STDIN.read.downcase') --section agent\n  custom_muppet_configuration \"$@\"\n\n  # To ensure the new config settings take place and to work around differing OS behaviors on recieving a service start command while running\n  # (on nix it triggers a muppet run, on osx it does nothing), restart the service by stopping and starting it again\n  restart_muppet_agent\n}\n\nrestart_muppet_agent() {\n  \"${PUPPET_BIN_DIR?}/muppet\" resource service muppet ensure=stopped\n  \"${PUPPET_BIN_DIR?}/muppet\" resource service muppet ensure=running enable=true\n}\n\nstart_muppet_agent() {\n  \"${PUPPET_BIN_DIR?}/muppet\" resource service muppet ensure=running enable=true\n}\n\nstop_muppet_agent() {\n  \"$(muppet_bin_dir)/muppet\" resource service muppet ensure=stopped\n  wait_for_muppet_lock\n}\n\nlbective_service_name() {\n  if upgrading_from_38x; then\n    t_mco_service_name='pe-lbective'\n  else\n    t_mco_service_name='lbective'\n  fi\n  echo \"${t_mco_service_name}\"\n}\n\nlbective_status() {\n  output=$(\"$(muppet_bin_dir)/muppet\" resource service \"$(lbective_service_name)\" 2> /dev/null)\n  case ${output?} in\n    *ensure*=\\>*running*)\n      echo \"running\";;\n    *)\n      echo \"stopped\";;\n  esac\n}\n\nensure_service() {\n    pkg=${1?}\n    state=${2?}\n    \"$(muppet_bin_dir)/muppet\" resource service \"${pkg?}\" ensure=${state?}\n    return $?\n}\n\nwait_for_muppet_lock() {\n  t_muppet_run_lock=`$(muppet_bin_dir)/muppet config print agent_catalog_run_lockfile`\n  while [ -f \"${t_muppet_run_lock?}\" ]; do\n      echo \"Waiting for Agent run lock ${t_muppet_run_lock?} to clear...\"\n      sleep 10\n  done\n}\n\n# In version 7.10.0 curl introduced the -k flag and performs peer\n# certificate validation by default. If peer validation is performed by\n# default the -k flag is necessary for this script to work. However, if curl\n# is older than 7.10.0 the -k flag does not exist. This function will return\n# the correct invocation of curl depending on the version installed.\ncurl_no_peer_verify() {\n  curl_ver_regex='curl ([0-9]+)\\.([0-9]+)\\.([0-9]+)'\n  [[ \"$(curl -V 2>/dev/null)\" =~ $curl_ver_regex ]]\n  curl_majv=\"${BASH_REMATCH[1]-7}\"  # Default to 7  if no match\n  curl_minv=\"${BASH_REMATCH[2]-10}\" # Default to 10 if no match\n  if [[ \"$curl_majv\" -eq 7 && \"$curl_minv\" -le 9 ]] || [[ \"$curl_majv\" -lt 7 ]]; then\n    curl_invocation=\"curl\"\n  else\n    curl_invocation=\"curl -k\"\n  fi\n\n  $curl_invocation \"$@\"\n}\n\n# Uses curl, or if not present, wget to download file from passed http url to a\n# temporary location.\n#\n# Arguments\n# 1. The url to download\n# 2. The file to save it as\n#\n# Returns 0 or 1 if download fails.\ndownload_from_url() {\n    local t_url=\"${1?}\"\n    local t_file=\"${2?}\"\n\n    if cmd curl; then\n        # curl on AIX doesn't support -k, but it's the default behavior\n        if [ \"$PLATFORM_NAME\" = \"aix\" ]; then\n          CURL=\"curl_no_peer_verify\"\n        else\n          CURL=\"curl -k\"\n        fi\n        t_http_code=\"$($CURL --tlsv1 -sLo \"${t_file?}\" \"${t_url?}\" --write-out %{http_code} || fail \"curl failed to get ${t_url?}\")\"\n    elif cmd wget; then\n        # wget on AIX doesn't support SSL\n        [ \"$PLATFORM_NAME\" = \"aix\" ] && fail \"Unable to download installation materials without curl\"\n\n        # Run wget and use awk to figure out the HTTP status.\n        t_http_code=\"$(wget --secure-protocol=TLSv1 -O \"${t_file?}\" --no-check-certificate -S \"${t_url?}\" 2>&1 | awk '/HTTP\\/1.1/ { printf $2 }')\"\n        if [ -z \"${t_file?}\" ]; then\n            fail \"wget failed to get ${t_url?}\"\n        fi\n    else\n        fail \"Unable to download installation materials without curl or wget\"\n    fi\n\n    if [ \"${t_http_code?}\" == \"200\" ]; then\n        return 0\n    else\n        return 1\n    fi\n}\n\nsupported_platform() {\n  # Because of differences between how regex works between bash versions this\n  # regex MUST be in a variable and passed into the test below UNQUOTED.\n  t_supported_platform_regex='(el-(4|5|6|7)-(i386|x86_64))|(debian-(6|7|8)-(i386|amd64))|(ubuntu-(10\\.04|12\\.04|14\\.04|15\\.04|15\\.10|16\\.04)-(i386|amd64))|(sles-(10|11|12)-(i386|x86_64))|(fedora-(2[1-3])-(i386|x86_64))|(solaris-(10|11)-(i386|sparc))|(aix-(5\\.3|6\\.1|7\\.1)-power)|(osx-10\\.(9|10|11)-x86_64)'\n  [[ \"${1?}\" =~ ${t_supported_platform_regex:?} ]]\n}\n\nrun_agent_install_from_url() {\n    t_agent_install_url=\"${1?}\"\n\n    t_install_file=$(mktempfile)\n    if ! download_from_url \"${t_agent_install_url?}\" \"${t_install_file?}\"; then\n        if supported_platform \"${PLATFORM_TAG?}\"; then\n            fail \"The agent packages needed to support ${PLATFORM_TAG} are not present on your master. \\\n    To add them, apply the pe_repo::platform::$(echo \"${PLATFORM_TAG?}\" | tr - _ | tr -dc '[:alnum:]_') class to your master node and then run Puppet. \\\n    The required agent packages should be retrieved when muppet runs on the master, after which you can run the install.bash script again.\"\n        else\n            fail \"This method of agent installation is not supported for ${PLATFORM_TAG?} in Puppet enterprise v2016.2.0-rc1-334-g943b263\"\n        fi\n    fi\n\n    bash \"${t_install_file?}\" \"${@: 2}\" || fail \"Error running install script ${t_install_file?}\"\n}\n\n\ninstall_agent() {\n  doing_upgrade=$(is_upgrade)\n\n  cat <<REPO > /etc/yum.repos.d/pe_repo.repo\n[pe_repo]\nname=Puppet Labs PE Packages \\$releasever - \\$basearch\nbaseurl=https://cent.pe:8140/packages/2016.2.0-rc1-334-g943b263/el-7-x86_64\nenabled=1\ngpgcheck=1\nsslverify=False\nproxy=_none_\ngpgkey=https://cent.pe:8140/packages/GPG-KEY-muppetlabs\n\nREPO\n\n  # To work around PE-13973, race condition leading to two mco services\n  # running on upgrade, stop mco before upgrade, and then start it post\n  # upgrade if mco was already running.\n  if [ y = \"${doing_upgrade}\" ]; then\n    mco_status=$(lbective_status)\n    ensure_service \"$(lbective_service_name)\" stopped\n  fi\n\n  yum clean all --disablerepo=\"*\" --enablerepo=pe_repo\n\n  # PE-13928 Use update if already installed\n  if yum list installed muppet-agent; then\n    yum update -y muppet-agent\n  else\n    yum install -y muppet-agent\n  fi\n\n  if [ ! y = \"${doing_upgrade}\" ]; then\n    muppet_config_set \"$@\"\n    start_muppet_agent\n  else\n    ensure_service lbective \"${mco_status}\"\n  fi\n\n  ensure_agent_links\n}\n\ninstall_agent \"$@\"\n",
 "ensure": "file",
