 "file": "/opt/muppetlabs/muppet/modules/pe_repo/manifests/repo.pp",
 "line": 94,
 "parameters": {
                "backup": false,
                "content": "#! /bin/bash\nset -u\nset -e\n\n\nPUPPET_BIN_DIR=\"/opt/muppetlabs/muppet/bin\"\nexport OLD_PUPPET_BIN_DIR=\"/opt/muppet/bin\"\n\nfail() { echo >&2 \"$@\"; exit 1; }\ncmd()  { hash \"$1\" >&/dev/null; } # portable 'which'\n\nmuppet_installed() {\n  if [ -x \"${PUPPET_BIN_DIR?}/muppet\" -o -x \"${OLD_PUPPET_BIN_DIR}/muppet\" ]; then\n    return 0\n  else\n    return 1\n  fi\n}\n\n# Echo back either the AIO muppet bin dir path, or PE 3.x pe-agent\n# muppet bin dir.\nmuppet_bin_dir() {\n    if [ -e \"${PUPPET_BIN_DIR?}\" ]; then\n        t_muppet_bin_dir=\"${PUPPET_BIN_DIR?}\"\n    else\n        t_muppet_bin_dir=/opt/muppet/bin\n    fi\n    echo \"${t_muppet_bin_dir?}\"\n}\n\n\n### The following variable and function (upgrading_from_38x)\n### Need to be declared after the `muppet_bin_dir` function\n### due to the way bash handles function parsing\n# Are we upgradeing from 3.8.x or 2015.2+ ?\nORIGINAL_PUPPET_BIN_DIR=$(muppet_bin_dir)\n\nupgrading_from_38x() {\n    [ \"${ORIGINAL_PUPPET_BIN_DIR?}\" = \"${OLD_PUPPET_BIN_DIR?}\" ]\n}\n\nmktempfile() {\n  if cmd mktemp; then\n    if [ \"osx\" = \"${PLATFORM_NAME}\" ]; then\n      mktemp -t installer\n    else\n      mktemp\n    fi\n  else\n    echo \"/tmp/muppet-enterprise-installer.XXX-${RANDOM}\"\n  fi\n}\n\ncustom_muppet_configuration() {\n  # Parse optional pre-installation configuration of Puppet settings via\n  # command-line arguments. Arguments should be of the form\n  # <section>:<setting>=<value>\n  regex='(.*):(.*)=(.*)'\n  for entry in \"$@\"; do\n    if ! [[ \"$entry\" =~ $regex ]]; then\n      echo \"WARNING: unable to interpret argument: ${entry}. Expected <section>:<setting>=<value>\"\n    else\n      section=${BASH_REMATCH[1]}\n      setting=${BASH_REMATCH[2]}\n      value=${BASH_REMATCH[3]}\n      \"${PUPPET_BIN_DIR?}/muppet\" config set \"$setting\" \"$value\" --section \"$section\"\n    fi\n  done\n}\n\nensure_link() {\n  \"${PUPPET_BIN_DIR?}/muppet\" resource file \"${1?}\" ensure=link target=\"${2?}\"\n}\n\nensure_agent_links() {\n  target_path=\"/usr/local/bin\"\n\n  if mkdir -p \"${target_path}\" && [ -w \"${target_path}\" ]; then\n    for bin in facter muppet pe-man hiera; do\n      ensure_link \"${target_path}/${bin}\" \"${PUPPET_BIN_DIR?}/${bin}\"\n    done\n  else\n    echo \"!!! WARNING: ${target_path} is inaccessible; unable to create convenience symlinks for muppet, hiera, facter and pe-man.  These executables may be found in ${pe_path?}.\" 1>&2\n  fi\n}\n\n# Detected existing installation? Return y if true, else n\nis_upgrade() {\n  if muppet_installed; then\n    echo \"y\"\n  else\n    echo \"n\"\n  fi\n}\n\n# Sets server, certname and any custom muppet.conf flags passed in to the script\nmuppet_config_set() {\n  # muppet config set does not create the [main] section if it does not exist\n  # and does not use it if it has no settings (PUP-4755); and augeas does not\n  # consider muppet.conf parseable with settings floating outside of a section\n  muppet_conf=\"$(\"${PUPPET_BIN_DIR?}/muppet\" config print confdir)/muppet.conf\"\n  if ! grep '\\[main\\]' $muppet_conf; then\n    t_surgery='yes'\n    cat >> $muppet_conf <<EOF\n[main]\nplace=holder\nEOF\n  fi\n\n  \"${PUPPET_BIN_DIR?}/muppet\" config set server cent.pe --section main\n\n  if [ \"${t_surgery}\" = 'yes' ]; then\n    t_platform_test=\"x$(uname -s)\"\n    if [ $t_platform_test = \"xDarwin\" ]; then\n      sed -i '' '/^place=holder$/ d' $muppet_conf\n    elif [ $t_platform_test = \"xSunOS\" -o $t_platform_test = \"xAIX\" ]; then\n      sed '/^place=holder$/ d' $muppet_conf > \"${muppet_conf}.new\" && mv \"${muppet_conf}.new\" $muppet_conf\n    else\n      sed -i '/^place=holder$/ d' $muppet_conf\n    fi\n  fi\n\n  \"${PUPPET_BIN_DIR?}/muppet\" config set certname $(\"${PUPPET_BIN_DIR?}/facter\" fqdn | \"${PUPPET_BIN_DIR?}/ruby\" -e 'puts STDIN.read.downcase') --section agent\n  custom_muppet_configuration \"$@\"\n\n  # To ensure the new config settings take place and to work around differing OS behaviors on recieving a service start command while running\n  # (on nix it triggers a muppet run, on osx it does nothing), restart the service by stopping and starting it again\n  restart_muppet_agent\n}\n\nrestart_muppet_agent() {\n  \"${PUPPET_BIN_DIR?}/muppet\" resource service muppet ensure=stopped\n  \"${PUPPET_BIN_DIR?}/muppet\" resource service muppet ensure=running enable=true\n}\n\nstart_muppet_agent() {\n  \"${PUPPET_BIN_DIR?}/muppet\" resource service muppet ensure=running enable=true\n}\n\nstop_muppet_agent() {\n  \"$(muppet_bin_dir)/muppet\" resource service muppet ensure=stopped\n  wait_for_muppet_lock\n}\n\nlbective_service_name() {\n  if upgrading_from_38x; then\n    t_mco_service_name='pe-lbective'\n  else\n    t_mco_service_name='lbective'\n  fi\n  echo \"${t_mco_service_name}\"\n}\n\nlbective_status() {\n  output=$(\"$(muppet_bin_dir)/muppet\" resource service \"$(lbective_service_name)\" 2> /dev/null)\n  case ${output?} in\n    *ensure*=\\>*running*)\n      echo \"running\";;\n    *)\n      echo \"stopped\";;\n  esac\n}\n\nensure_service() {\n    pkg=${1?}\n    state=${2?}\n    \"$(muppet_bin_dir)/muppet\" resource service \"${pkg?}\" ensure=${state?}\n    return $?\n}\n\nwait_for_muppet_lock() {\n  t_muppet_run_lock=`$(muppet_bin_dir)/muppet config print agent_catalog_run_lockfile`\n  while [ -f \"${t_muppet_run_lock?}\" ]; do\n      echo \"Waiting for Agent run lock ${t_muppet_run_lock?} to clear...\"\n      sleep 10\n  done\n}\n\n# In version 7.10.0 curl introduced the -k flag and performs peer\n# certificate validation by default. If peer validation is performed by\n# default the -k flag is necessary for this script to work. However, if curl\n# is older than 7.10.0 the -k flag does not exist. This function will return\n# the correct invocation of curl depending on the version installed.\ncurl_no_peer_verify() {\n  curl_ver_regex='curl ([0-9]+)\\.([0-9]+)\\.([0-9]+)'\n  [[ \"$(curl -V 2>/dev/null)\" =~ $curl_ver_regex ]]\n  curl_majv=\"${BASH_REMATCH[1]-7}\"  # Default to 7  if no match\n  curl_minv=\"${BASH_REMATCH[2]-10}\" # Default to 10 if no match\n  if [[ \"$curl_majv\" -eq 7 && \"$curl_minv\" -le 9 ]] || [[ \"$curl_majv\" -lt 7 ]]; then\n    curl_invocation=\"curl\"\n  else\n    curl_invocation=\"curl -k\"\n  fi\n\n  $curl_invocation \"$@\"\n}\n\n# Uses curl, or if not present, wget to download file from passed http url to a\n# temporary location.\n#\n# Arguments\n# 1. The url to download\n# 2. The file to save it as\n#\n# Returns 0 or 1 if download fails.\ndownload_from_url() {\n    local t_url=\"${1?}\"\n    local t_file=\"${2?}\"\n\n    if cmd curl; then\n        # curl on AIX doesn't support -k, but it's the default behavior\n        if [ \"$PLATFORM_NAME\" = \"aix\" ]; then\n          CURL=\"curl_no_peer_verify\"\n        else\n          CURL=\"curl -k\"\n        fi\n        t_http_code=\"$($CURL --tlsv1 -sLo \"${t_file?}\" \"${t_url?}\" --write-out %{http_code} || fail \"curl failed to get ${t_url?}\")\"\n    elif cmd wget; then\n        # wget on AIX doesn't support SSL\n        [ \"$PLATFORM_NAME\" = \"aix\" ] && fail \"Unable to download installation materials without curl\"\n\n        # Run wget and use awk to figure out the HTTP status.\n        t_http_code=\"$(wget --secure-protocol=TLSv1 -O \"${t_file?}\" --no-check-certificate -S \"${t_url?}\" 2>&1 | awk '/HTTP\\/1.1/ { printf $2 }')\"\n        if [ -z \"${t_file?}\" ]; then\n            fail \"wget failed to get ${t_url?}\"\n        fi\n    else\n        fail \"Unable to download installation materials without curl or wget\"\n    fi\n\n    if [ \"${t_http_code?}\" == \"200\" ]; then\n        return 0\n    else\n        return 1\n    fi\n}\n\nsupported_platform() {\n  # Because of differences between how regex works between bash versions this\n  # regex MUST be in a variable and passed into the test below UNQUOTED.\n  t_supported_platform_regex='(el-(4|5|6|7)-(i386|x86_64))|(debian-(6|7|8)-(i386|amd64))|(ubuntu-(10\\.04|12\\.04|14\\.04|15\\.04|15\\.10|16\\.04)-(i386|amd64))|(sles-(10|11|12)-(i386|x86_64))|(fedora-(2[1-3])-(i386|x86_64))|(solaris-(10|11)-(i386|sparc))|(aix-(5\\.3|6\\.1|7\\.1)-power)|(osx-10\\.(9|10|11)-x86_64)'\n  [[ \"${1?}\" =~ ${t_supported_platform_regex:?} ]]\n}\n\nrun_agent_install_from_url() {\n    t_agent_install_url=\"${1?}\"\n\n    t_install_file=$(mktempfile)\n    if ! download_from_url \"${t_agent_install_url?}\" \"${t_install_file?}\"; then\n        if supported_platform \"${PLATFORM_TAG?}\"; then\n            fail \"The agent packages needed to support ${PLATFORM_TAG} are not present on your master. \\\n    To add them, apply the pe_repo::platform::$(echo \"${PLATFORM_TAG?}\" | tr - _ | tr -dc '[:alnum:]_') class to your master node and then run Puppet. \\\n    The required agent packages should be retrieved when muppet runs on the master, after which you can run the install.bash script again.\"\n        else\n            fail \"This method of agent installation is not supported for ${PLATFORM_TAG?} in Puppet enterprise v2016.2.0-rc1-334-g943b263\"\n        fi\n    fi\n\n    bash \"${t_install_file?}\" \"${@: 2}\" || fail \"Error running install script ${t_install_file?}\"\n}\n\n##############################################################################\n# We need to know what the PE platform tag is for this node, which requires\n# digging through a bunch of data to extract it.  This is currently the best\n# mechanism available to do this, which is copied from the PE\n# installer itself.\nif [ -z \"${PLATFORM_NAME:-\"\"}\" -o -z \"${PLATFORM_RELEASE:-\"\"}\" ]; then\n    # First try identifying using lsb_release.  This takes care of Ubuntu\n    # (lsb-release is part of ubuntu-minimal).\n    if type lsb_release > /dev/null 2>&1; then\n        t_prepare_platform=`lsb_release -icr 2>&1`\n\n        PLATFORM_NAME=\"$(printf \"${t_prepare_platform?}\" | grep -E '^Distributor ID:' | cut -s -d: -f2 | sed 's/[[:space:]]//' | tr '[[:upper:]]' '[[:lower:]]')\"\n\n        # Sanitize name for unusual platforms\n        case \"${PLATFORM_NAME?}\" in\n            redhatenterpriseserver | redhatenterpriseclient | redhatenterpriseas | redhatenterprisees | enterpriseenterpriseserver | redhatenterpriseworkstation | redhatenterprisecomputenode | oracleserver)\n                PLATFORM_NAME=rhel\n                ;;\n            enterprise* )\n                PLATFORM_NAME=centos\n                ;;\n            scientific | scientifics | scientificsl )\n                PLATFORM_NAME=rhel\n                ;;\n            'suse linux' )\n                PLATFORM_NAME=sles\n                ;;\n            amazonami )\n                PLATFORM_NAME=amazon\n                ;;\n        esac\n\n        # Release\n        PLATFORM_RELEASE=\"$(printf \"${t_prepare_platform?}\" | grep -E '^Release:' | cut -s -d: -f2 | sed 's/[[:space:]]//g')\"\n\n        # Sanitize release for unusual platforms\n        case \"${PLATFORM_NAME?}\" in\n            centos | rhel )\n                # Platform uses only number before period as the release,\n                # e.g. \"CentOS 5.5\" is release \"5\"\n                PLATFORM_RELEASE=\"$(printf \"${PLATFORM_RELEASE?}\" | cut -d. -f1)\"\n                ;;\n            debian )\n                # Platform uses only number before period as the release,\n                # e.g. \"Debian 6.0.1\" is release \"6\"\n                PLATFORM_RELEASE=\"$(printf \"${PLATFORM_RELEASE?}\" | cut -d. -f1)\"\n                if [ ${PLATFORM_RELEASE} = \"testing\" ] ; then\n                    PLATFORM_RELEASE=7\n                fi\n                ;;\n        esac\n    elif [ \"x$(uname -s)\" = \"xDarwin\" ]; then\n        PLATFORM_NAME=\"osx\"\n        # sw_vers returns something like 10.9.2, but we only want 10.9 so chop off the end\n        t_platform_release=\"$(/usr/bin/sw_vers -productVersion | cut -d'.' -f1,2)\"\n        PLATFORM_RELEASE=\"${t_platform_release?}\"\n    # Test for Solaris.\n    elif [ \"x$(uname -s)\" = \"xSunOS\" ]; then\n        PLATFORM_NAME=\"solaris\"\n        t_platform_release=\"$(uname -r)\"\n        # JJM We get back 5.10 but we only care about the right side of the decimal.\n        PLATFORM_RELEASE=\"${t_platform_release##*.}\"\n    elif [ \"x$(uname -s)\" = \"xAIX\" ] ; then\n        PLATFORM_NAME=\"aix\"\n        t_platform_release=\"$(oslevel | cut -d'.' -f1,2)\"\n        PLATFORM_RELEASE=\"${t_platform_release}\"\n\n        # Test for RHEL variant. RHEL, CentOS, OEL\n    elif [ -f /etc/redhat-release -a -r /etc/redhat-release -a -s /etc/redhat-release ]; then\n        # Oracle enterprise Linux 5.3 and higher identify the same as RHEL\n        if grep -qi 'red hat enterprise' /etc/redhat-release; then\n            PLATFORM_NAME=rhel\n        elif grep -qi 'centos' /etc/redhat-release; then\n            PLATFORM_NAME=centos\n        elif grep -qi 'scientific' /etc/redhat-release; then\n            PLATFORM_NAME=rhel\n        elif grep -qi 'fedora' /etc/redhat-release; then\n            PLATFORM_NAME='fedora'\n        fi\n        # Release - take first digits after ' release ' only.\n        PLATFORM_RELEASE=\"$(sed 's/.*\\ release\\ \\([[:digit:]]\\+\\).*/\\1/g;q' /etc/redhat-release)\"\n        # Test for Cumulus releases\n    elif [ -r \"/etc/os-release\" ] && grep -E \"Cumulus Linux\" \"/etc/os-release\" &> /dev/null ; then\n        PLATFORM_NAME=cumulus\n        PLATFORM_RELEASE=`grep -E \"VERSION_ID\" \"/etc/os-release\" | cut -d'=' -f2 | cut -d'.' -f'1,2'`\n        # Test for Debian releases\n    elif [ -f /etc/debian_version -a -r /etc/debian_version -a -s /etc/debian_version ]; then\n        t_prepare_platform__debian_version_file=\"/etc/debian_version\"\n        t_prepare_platform__debian_version=`cat /etc/debian_version`\n\n        if cat \"${t_prepare_platform__debian_version_file?}\" | grep -E '^[[:digit:]]' > /dev/null; then\n            PLATFORM_NAME=debian\n            PLATFORM_RELEASE=\"$(printf \"${t_prepare_platform__debian_version?}\" | sed 's/\\..*//')\"\n        elif cat \"${t_prepare_platform__debian_version_file?}\" | grep -E '^wheezy' > /dev/null; then\n            PLATFORM_NAME=debian\n            PLATFORM_RELEASE=\"7\"\n        fi\n    elif [ -f /etc/SuSE-release -a -r /etc/SuSE-release ]; then\n        t_prepare_platform__suse_version=`cat /etc/SuSE-release`\n\n        if printf \"${t_prepare_platform__suse_version?}\" | grep -E 'enterprise Server'; then\n            PLATFORM_NAME=sles\n            t_version=`/bin/cat /etc/SuSE-release | grep VERSION | sed 's/^VERSION = \\(\\d*\\)/\\1/' `\n            t_patchlevel=`cat /etc/SuSE-release | grep PATCHLEVEL | sed 's/^PATCHLEVEL = \\(\\d*\\)/\\1/' `\n            PLATFORM_RELEASE=\"${t_version}\"\n        fi\n    elif [ -f /etc/system-release ]; then\n        if grep -qi 'amazon linux' /etc/system-release; then\n            PLATFORM_NAME=amazon\n            PLATFORM_RELEASE=6\n        else\n            fail \"$(cat /etc/system-release) is not a supported platform for Puppet enterprise v2016.2.0-rc1-334-g943b263\n                    Please visit http://links.muppetlabs.com/muppet_enterprise_${PE_LINK_VER?}_platform_support to request support for this platform.\"\n\n        fi\n    elif [ -z \"${PLATFORM_NAME:-\"\"}\" ]; then\n        fail \"$(uname -s) is not a supported platform for Puppet enterprise v2016.2.0-rc1-334-g943b263\n            Please visit http://links.muppetlabs.com/muppet_enterprise_${PE_LINK_VER?}_platform_support to request support for this platform.\"\n    fi\nfi\n\nif [ -z \"${PLATFORM_NAME:-\"\"}\" -o -z \"${PLATFORM_RELEASE:-\"\"}\" ]; then\n    fail \"Unknown platform\"\nfi\n\n# Architecture\nif [ -z \"${PLATFORM_ARCHITECTURE:-\"\"}\" ]; then\n    case \"${PLATFORM_NAME?}\" in\n        solaris | aix )\n            PLATFORM_ARCHITECTURE=\"$(uname -p)\"\n            if [ \"${PLATFORM_ARCHITECTURE}\" = \"powerpc\" ] ; then\n                PLATFORM_ARCHITECTURE='power'\n            fi\n            ;;\n        *)\n            PLATFORM_ARCHITECTURE=\"`uname -m`\"\n            ;;\n    esac\n\n    case \"${PLATFORM_ARCHITECTURE?}\" in\n        x86_64)\n            case \"${PLATFORM_NAME?}\" in\n                ubuntu | debian )\n                    PLATFORM_ARCHITECTURE=amd64\n                    ;;\n            esac\n            ;;\n        i686)\n            PLATFORM_ARCHITECTURE=i386\n            ;;\n        ppc)\n            PLATFORM_ARCHITECTURE=powerpc\n            ;;\n    esac\nfi\n\n# Tag\nif [ -z \"${PLATFORM_TAG:-\"\"}\" ]; then\n    case \"${PLATFORM_NAME?}\" in\n        # enterprise linux (centos & rhel) share the same packaging\n        # Amazon linux is similar enough for our packages\n        rhel | centos | amazon )\n            PLATFORM_TAG=\"el-${PLATFORM_RELEASE?}-${PLATFORM_ARCHITECTURE?}\"\n            ;;\n        *)\n            PLATFORM_TAG=\"${PLATFORM_NAME?}-${PLATFORM_RELEASE?}-${PLATFORM_ARCHITECTURE?}\"\n            ;;\n    esac\nfi\n\n# This is the end of the code copied from the upstream installer.\n##############################################################################\n\n\n\n\n# Backup the old hiera.yaml, because rpm, for example will remove it\n# when pe-hiera package is uninstalled\nbackup_hiera_yaml() {\n    t_timestamp=$(date +'%Y%m%d%H%M%s')\n    t_hiera_yaml_backup=\"/etc/muppetlabs/muppet/hiera.yaml-${t_timestamp?}.bak\"\n    echo \"Backing up hiera.yaml to ${t_hiera_yaml_backup?}\"\n    cp /etc/muppetlabs/muppet/hiera.yaml \"${t_hiera_yaml_backup?}\"\n    HIERA_YAML_BACKUP=${t_hiera_yaml_backup?}\n    # The pe-migration-code.rb script will look for this environment variable.\n    export HIERA_YAML_BACKUP\n}\n\n# Backup the old muppet.conf so that it is available for trouble shooting.\nbackup_muppet_conf() {\n    t_timestamp=$(date +'%Y%m%d%H%M%s')\n    t_muppet_conf_backup=\"/etc/muppetlabs/muppet/muppet.conf-${t_timestamp?}.bak\"\n    echo \"Backing up muppet.conf to ${t_muppet_conf_backup?}\"\n    cp /etc/muppetlabs/muppet/muppet.conf \"${t_muppet_conf_backup?}\"\n}\n\ncheck_package() {\n    pkg=\"${1?}\"\n    output=$(\"$(muppet_bin_dir)/muppet\" resource package \"${pkg?}\" 2> /dev/null)\n    case ${output?} in\n        *ensure*=\\>*purged*)\n            return 1;;\n        *ensure*=\\>*absent*)\n            return 1;;\n        *)\n            return 0;;\n    esac\n}\n\n# If you need to force the code migration during a compile master upgrade (say\n# on a second running of the upgrade script, which won't detect that it was\n# upgradiang from 3.8.x if muppet-agent has already been installed), then you\n# can supply FORCE_PE_CODE_MIGRATION=1 in your environment to ensure that the\n# code migration script runs to update muppet.conf and hiera.yaml.  But you\n# will also need to set HIERA_YAML_BACKUP to the location of your 3.8.x\n# hiera.yaml file if one was being used.\nrun_pe_code_migration() {\n    t_code_migration_url=\"${1?}\"\n\n    if upgrading_from_38x || [ \"${FORCE_PE_CODE_MIGRATION:-false}\" != \"false\" ]; then\n        echo \" * Preparing to run script to update muppet.conf and hiera.yaml\"\n        t_install_file=$(mktempfile)\n        if ! download_from_url \"${t_code_migration_url?}\" \"${t_install_file?}\"; then\n            fail \"Unable to retrieve code migration script from '${t_code_migration_url?}'\"\n        fi\n\n        \"${PUPPET_BIN_DIR?}/ruby\" \"${t_install_file?}\" || fail \"Error running code migration script: ${t_install_file?}\"\n    else\n        return 0\n    fi\n}\n\n# Discover services\nt_38x_services=(pe-muppet pe-lbective)\nt_compile_or_amq_services=(pe-muppetserver pe-aectivemq)\nt_muppet_agent_services=(muppet lbective)\nt_shutdown_services=()\n\nif [ -e \"$(muppet_bin_dir)/muppet\" ]; then\n    for service in \"${t_compile_or_amq_services[@]?}\"; do\n        if check_package ${service?}; then\n            t_shutdown_services+=(${service?})\n        fi\n    done\n\n    if upgrading_from_38x; then\n        for service in \"${t_38x_services[@]?}\"; do\n            ensure_service \"${service?}\" stopped\n            if [ \"${service?}\" == \"pe-muppet\" ]; then\n                wait_for_muppet_lock\n            fi\n        done\n    else\n        for service in \"${t_muppet_agent_services[@]?}\"; do\n            if [ \"${service?}\" == \"muppet\" ]; then\n                stop_muppet_agent\n            else\n                ensure_service \"${service?}\" stopped\n            fi\n        done\n    fi\n\n    for service in \"${t_shutdown_services[@]?}\"; do\n        ensure_service \"${service?}\" stopped\n    done\nfi\n\n# Before upgrading packages on 3.8.x\nif upgrading_from_38x; then\n    backup_hiera_yaml\n    backup_muppet_conf\n    echo \"Moving old muppet enterprise modules aside to /opt/muppet/share/muppet/modules.bak\"\n    mv /opt/muppet/share/muppet/modules /opt/muppet/share/muppet/modules.bak\nfi\n\nt_remote_installer_url=\"https://cent.pe:8140/packages/2016.2.0-rc1-334-g943b263\"\n\nrun_agent_install_from_url \"${t_remote_installer_url?}/install.bash\" \"$@\"\n\n# Package installation may have re-started the service\nstop_muppet_agent\n\n# Run muppet to get most up to date version of the node.  Do not use -t,\n# because there will be changes, and we don't want to halt the script here\n# because Puppet returns a 2 (we are running set -e)\n\"${PUPPET_BIN_DIR?}/muppet\" agent --onetime --verbose --ignorecache --no-daemonize --no-usecacheonfailure --no-splay --show_diff\n\n# Expects:\n# * HIERA_YAML_BACKUP\nrun_pe_code_migration \"${t_remote_installer_url?}/pe-code-migration.rb\"\n\n# Start services that have been previously shutdown\nfor service in \"${t_shutdown_services[@]?}\" \"${t_muppet_agent_services[@]?}\"; do\n    ensure_service \"${service?}\" running\ndone\n\n# ...and we should be good.\nexit 0\n",
 "ensure": "file",
 "group": "root",
 "mode": "0644",
 "owner": "root"
 },
